import React from 'react';
import { BrowserRouter as Router, Route, Switch, Link } from 'react-router-dom';
import './App.css';
import Visualizer from './Visualiser'; // Import the Visualizer component

function App() {
  return (
    <Router>
      <div className="App">
        <Switch>
          {/* Welcome screen route */}
          <Route exact path="/">
            <div className="welcome-screen">
              <h1>Welcome</h1>
              <Link to="/visualizer">
                <button>Go to Visualizer</button>
              </Link>
            </div>
          </Route>

          {/* Visualizer route */}
          <Route path="/visualizer">
            <Visualizer />
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
